import React, { Component } from 'react'

type YoutubeProps = {
  url: string
}

export class Youtube extends Component<YoutubeProps> {
  render() {
    return (
      <>
        <iframe src={this.props.url} width="100%" frameBorder="0" allow="autoplay; encrypted-media" allowFullScreen></iframe>
      </>
    )
  }
}

export default Youtube
